PolygonTestdata.prototype = {
	
	constructor: PolygonTestdata,
	
	get_polygon_with_holes: function ( inDataName, inMirrorLine, inMirrorStr ) {

		function mirror_polygon_X( inPolygons, inX ) {
			var inX2 = 2*inX;
			return	inPolygons.map( function (list, lidx, larray) {
				return	list.map( function (val, idx, array) {
					return	{ x: inX2 - val.x, y: val.y };
				} ).reverse();			// restore CW/CCW-Order
			} );
		}
		function mirror_polygon_Y( inPolygons, inY ) {
			var inY2 = 2*inY;
			return	inPolygons.map( function (list, lidx, larray) {
				return	list.map( function (val, idx, array) {
					return	{ x: val.x, y: inY2 - val.y };
				} ).reverse();			// restore CW/CCW-Order
			} );
		}
		
		//
		if ( ( inDataName == "squares_perftest_min" ) ||
			 ( inDataName == "squares_perftest_mid" ) ||
			 ( inDataName == "squares_perftest_max" ) ) {
			// for Performance-Test with 40x40 holes
			var	anzSquare = ( inDataName == "squares_perftest_max" ) ? 40 : 
								( ( inDataName == "squares_perftest_mid" ) ? 15 : 3 );
			var scale = Math.floor( 40.0/anzSquare );
			var shape = [ { x:40, y:40 }, { x: 0, y:40 }, { x: 0, y: 0 }, { x:40, y: 0 } ];
			var holeTemplate = [ { x:0.2, y:0.2 }, { x:0.2, y:0.8 }, { x:0.8, y:0.8 }, { x:0.8, y:0.2 } ];
			var polys = [ shape ];
			for (var i=0; i<anzSquare; i++) {
				for (var j=0; j<anzSquare; j++) {
					var hole = [];
					for (var k=0; k<holeTemplate.length; k++) {
						hole.push( { x: scale * (i + holeTemplate[k].x), y: scale * (j+ holeTemplate[k].y) } );
					}
					polys.push( hole );
				}
			}
			return	polys;
		} else {
			switch ( inMirrorStr ) {
			case "X":	return	mirror_polygon_X( this.polygons[inDataName], inMirrorLine );
			case "Y":	return	mirror_polygon_Y( this.polygons[inDataName], inMirrorLine );
			case "XY":	return	mirror_polygon_Y( mirror_polygon_X( this.polygons[inDataName], inMirrorLine ), inMirrorLine );
			case "YX":	return	mirror_polygon_X( mirror_polygon_Y( this.polygons[inDataName], inMirrorLine ), inMirrorLine );
			default:	return	this.polygons[inDataName].map( function (list, idx, array) {
							return	list.slice(0);
						} );
			}
		}
	},
	
	//##########################################################################
	
	get_triangles: function ( inDataName ) {
		return	this.sollTriangs[inDataName];
	},
	
	//###################################
	
	// Helper: translate Triangle-Vertex-Indices into Vertex-Coordinates
	triangIdxs2vertexCoords: function ( inTriangIdxs, inPolyHoles ) {
		var	polyverts = [];
		for (var i=0; i<inPolyHoles.length; i++) { polyverts = polyverts.concat(inPolyHoles[i]) }
		//
		return	inTriangIdxs.map( function (list, lidx, larray) {
			return	list.map( function (val, idx, array) {
				return	polyverts[val];
			} );
		} );
	},
	
	// Helper: translate Triangle-Vertex-Coordinates into Vertex-Indices
	triangCoords2vertexIds: function ( inTriangCoords, inPolyHoles ) {
		var triangVertexIdxs = [];

		var i, j, v;
		var len = inTriangCoords.length;
		//
		var	polyverts = [];
		for (i=0; i<inPolyHoles.length; i++) { polyverts = polyverts.concat(inPolyHoles[i]) }
		//
		for (i=0; i<len; i++) {
			var triangIdxs = [];
			for (j=0;j<3;j++) {
				var idx;
				for (v=0; v<polyverts.length; v++) {
					if ( ( polyverts[v].x == inTriangCoords[i][j].x ) &&
						 ( polyverts[v].y == inTriangCoords[i][j].y ) ) {
						idx = v; break;
					}
				}
				if ( idx == null ) {
					console.log( "triangCoords2vertexIds: no valid vertex coordinate: ", inTriangCoords[i][j], inPolyHoles );
				} else {
					triangIdxs.push(idx);
				}
			}
			if ( triangIdxs.length == 3 ) { triangVertexIdxs.push(triangIdxs) }
		}
		//
		return	triangVertexIdxs;
	},
	
	//##########################################################################
	
	polygons_to_str: function ( inPolygons, inHtmlBreaks ) {
		var lineBreak = inHtmlBreaks ? " <br/>\n" : " \n";

		var i, j, dumpStr = '';
		for (i=0;i<inPolygons.length;i++) {
			dumpStr += " [ ";
			for (j=0;j<inPolygons[i].length;j++) {
				dumpStr += " { x:" + inPolygons[i][j].x + ", y:" + inPolygons[i][j].y + " }, ";
			}
			dumpStr += " ]," + lineBreak;
		}
		return	dumpStr;
	}
	
};

